package com.example.bank.Model;public class Profile {    private int profileID;    private String username;    private String password;    private String fullname;    private String city;    private String address;    private String telephone_number;    public Profile(int profileID, String username, String password, String fullname, String city, String address, String telephone_number) {        this.profileID = profileID;        this.username = username;        this.password = password;        this.fullname = fullname;        this.city = city;        this.address = address;        this.telephone_number = telephone_number;    }    public int getProfileID() {        return profileID;    }    public void setProfileID(int profileID) {        this.profileID = profileID;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getFullname() {        return fullname;    }    public void setFullname(String fullname) {        this.fullname = fullname;    }    public String getCity() {        return city;    }    public void setCity(String city) {        this.city = city;    }    public String getAddress() {        return address;    }    public void setAddress(String address) {        this.address = address;    }    public String getTelephone_number() {        return telephone_number;    }    public void setTelephone_number(String telephone_number) {        this.telephone_number = telephone_number;    }}